import React from "react";
import { Col, Container, Row } from "react-bootstrap";

const StudUpdate = () => {
  return (
    <Container>
      <Row
        className="row row-cols-2"
        style={{ backgroundColor: "#68AEDB", width: "550px" }}
      >
        <Col>
          <h1>PAPA PEDRO</h1>
        </Col>

        <Col className="d-flex">
          <Row className="row row-cols-2 flex-fill mx-2">
            <Col style={{ backgroundColor: "#DEC618" }}>h
            </Col>

            <Col style={{ backgroundColor: "#9900FF" }}>h
            </Col>
          </Row>
        </Col>
      </Row>
    </Container>
  );
};

export default StudUpdate;
